const n=JSON.parse('{"key":"v-8da8f81a","path":"/storehouse/The%20proper%20of%20gobao.html","title":"高标科技的准备","lang":"zh-CN","frontmatter":{"title":"高标科技的准备","icon":"fab fa-markdown","order":9,"category":["测试"],"tag":["基本知识补充"],"prev":null},"headers":[],"git":{"createdTime":null,"updatedTime":null,"contributors":[]},"readingTime":{"minutes":2.34,"words":701},"filePathRelative":"storehouse/The proper of gobao.md","excerpt":"<p><a href=\\"https://blog.csdn.net/weixin_44793491/article/details/107298426\\" target=\\"_blank\\" rel=\\"noopener noreferrer\\">CAN</a></p>\\n<ul>\\n<li>\\n<p>测试用例： 编写输入条件，这个输入条件最好是能够比较覆盖整个程序的，能够直面程序薄弱的。</p>\\n</li>\\n<li>\\n<p>测漏率：项目发布之后所发现的线上缺陷数/这个项目总缺陷。</p>\\n</li>\\n</ul>\\n<p>测试侧漏是指软件产品在测试结束后出现了在测试过程中没有被发现的bug。</p>\\n<ul>\\n<li>\\n<p>性能测试: IO，外设等外设的运行情况。</p>\\n</li>\\n<li>\\n<p>整车测试：\\n整车可靠性测试： 不同工况下的可靠性和耐久度\\n常规试验、环境可靠性试验、密封性能试验、道路耐久性试验、室内模拟的碰撞\\n耐久试验、湿度试验、烟雾试验、振动试验。</p>\\n</li>\\n<li>\\n<p>NVH试验：针对噪声、振动、声振粗糙度。\\n使乘员感受到舒适的驾车和乘车环境，评估汽车零部件由于振动引起的强度和寿命问题。</p>\\n</li>\\n<li>\\n<p>EMC测试：</p>\\n</li>\\n<li>\\n<p>化学分析试验： 测试汽车的材料和挥发性气味</p>\\n</li>\\n</ul>"}');export{n as data};
